  [],\n\t\"revision_timestamp\": \"2015-09-27T00:19:31.383471\",\n\t\"name\": \"the-relationship-between-coral-reef-health-alien-algae-and-fish-biomass-at-sites-on-oahu-and-th\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Data in this set come from two studies:
  \"Ability of protected reefs to resist alien algae\" and \"How many fish does it
  take to keep the alien algae out?\" Both are authored by Ms. Danielle Jayewardene
  and Dr. Charles Birkeland of University of Hawaii Manoa, in 2005 and 2006, respectively.
  For the former, the goal was to objectively and quantitatively assess the ability
  of marine protected areas (MPAs), to maintain ecosystem health, and to thereby resist
  invasion of alien algae. For the latter, specific objectives involved a) determining
  whether there are differences in cropping ability by larger herbivorous fishes compared
  to smaller herbivorous fishes, and b) whether there is a threshold level of algal
  biomass above which even an increased number of herbivorous fishes simply cannot
  crop down. The field work took place at eight coral reef sites located on the island
  of Oahu and the island of Hawaii.\",\n\t\"license_title\": null,\n\t\"extras\":
